import React from "react";
import { Container, Row } from "reactstrap";

import Form from "./components/Form";
import Table from "./components/Table";

const Approvals = ({ load }) => {
  return (
    <Container>
      <Row>
        <Form />
      </Row>
      <Row>
        <Table load={load} />
      </Row>
    </Container>
  );
};

export default Approvals;
